Believe me, I’d rather be on set working.  Unfortunately getting a fair, equitable and updated contract is proving more difficult than we all hoped so we’re on the picket line instead.  The entertainment industry thrives due to all the artists who already sacrifice so much for their dreams and their craft.  Most of us are pretty accustomed to living with uncertainty.  Struggle is often an artist’s superpower.  What we CAN’T sacrifice is our healthcare, dignity and a base income that keeps up with inflation. 

#SagAftra #UnionStrong #sagaftrastrike #WGA #wgastrike 

